using deinBaum.DAL.Model;
using deinBaum.Lib.BaumStruktur;
using deinBaum.Lib.PersonDaten;
using Newtonsoft.Json;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Net;
using System.Text;
using System.Threading.Tasks;

namespace deinBaum.WebAPI.Test
{
    [TestFixture]
    public class BaumControllerTest
    {
        public HttpClient HttpClient { get; set; }
        public Uri BaseAdress { get; set; }
        public User User { get; set; }

        [SetUp]
        public void Setup()
        {
            BaseAdress = new Uri("https://localhost:7001/api/");
            HttpClient = new HttpClient();
            User = new()
            {
                Login = $"testAdmin",
                Password = "test123"
            };
        }

        /// <summary>
        /// Simuliert das Hinzufügen eines Baums.
        /// </summary>
        /// <returns></returns>
        [Test, Order(1)]
        public async Task AddBaumTest()
        {
            string fotobyteString = "";
            int baumid = -1;

            FeldmitarbeiterDTO dto = new FeldmitarbeiterDTO()
            {
                Name = "Tester",
                Vorname = "Admin",
                Profilbild = null,
                ArbeitetNochInDerFirma = true,
                Login = "testAdmin"
            };

            WaldeigentuemerDTO waldeigentuemerDTO = new WaldeigentuemerDTO()
            {
                Name = "kurt",
                Vorname = "kurti",
                PLZ = 7890,
                Ort = "hausen",
                MobileNr = "077777777",
                Email = "string@stringtest5.ch"
            };

            Baum baum = new Baum()
            {
                ParzellenNr = 24500,
                Name = "Testbaum",
                ErsteErfassung = DateTime.Now,
                LetzteBearbeitung = DateTime.Now,
                Baumhoehe = 840,
                Umfang = 56,
                Alter = 56,
                ZustandsListe = new List<BaumZustand>()
                {
                    new BaumZustand("lebendig") { ID = 2 },
                    new BaumZustand("stehend") { ID = 3 },
                },
                Merkmale = new List<BaumMerkmal>()
                {
                    new BaumMerkmal("mehrstämmig tiefer 1 m") { ID = 2 },
                    new BaumMerkmal("Zwiesel untere Stammhälfte") { ID = 3 },
                },
                Art = new BaumArt()
                {
                    ID = 3,
                    Art = "Abies alba"
                },
                FotoListe = new List<Lib.FotoStruktur.Foto>()
                {
                    new Lib.FotoStruktur.Foto()
                    {
                        Name = "Bildbeschreibung",
                        Fotobytes = Encoding.UTF8.GetBytes(fotobyteString)
                    }
                },
                Bemerkung = "Test VerSuch 1",
                WGS84_XKoordinaten = 123,
                WGS84_YKoordinaten = 123,
                EllipsoidischeHoehe = null,
                HoeheMeterUeberMeer = null,
                LV95_EKoordinaten = 0,
                LV95_NKoordinaten = 0,
                Feldmitarbeiter = new Feldmitarbeiter()
                {
                    ID = dto.ID,
                    Name = dto.Name,
                    Vorname = dto.Vorname,
                    ArbeitetNochInDerFirma = dto.ArbeitetNochInDerFirma,
                    Login = dto.Login,
                    Profilbild = dto.Profilbild
                },
                Waldeigentuemer = new Waldeigentuemer()
                {
                    ID = waldeigentuemerDTO.ID,
                    Name = waldeigentuemerDTO.Name,
                    Vorname = waldeigentuemerDTO.Vorname,
                    PLZ = waldeigentuemerDTO.PLZ,
                    Ort = waldeigentuemerDTO.Ort,
                    MobileNr = waldeigentuemerDTO.MobileNr,
                    Email = waldeigentuemerDTO.Email
                }

            };

            try
            {
                string request = JsonConvert.SerializeObject(User);

                var response = await HttpClient.PostAsync(BaseAdress + "Auth/register/",
                             new StringContent(request, Encoding.UTF8, "application/json"));

                response = await HttpClient.PostAsync(BaseAdress + "Auth/login/",
                             new StringContent(request, Encoding.UTF8, "application/json"));

                if (response.StatusCode == HttpStatusCode.OK)
                {
                    var json = await response.Content.ReadAsStringAsync();
                    LoginResponse loginResponse = JsonConvert.DeserializeObject<LoginResponse>(json);

                    HttpClient.DefaultRequestHeaders.Authorization = new System.Net.Http.Headers.AuthenticationHeaderValue("bearer", loginResponse.Token);


                    //Registrierung Feldmitarbeiter
                    request = JsonConvert.SerializeObject(dto);
                    response = await HttpClient.PostAsync($"{BaseAdress.AbsoluteUri}Feldmitarbeiter/",
                            new StringContent(request, Encoding.UTF8, "application/json"));
                    json = await response.Content.ReadAsStringAsync();

                    List<FeldmitarbeiterDTO> feldmitarbeiterDTOList = JsonConvert.DeserializeObject<List<FeldmitarbeiterDTO>>(json);
                    baum.Feldmitarbeiter.ID = feldmitarbeiterDTOList.Where(x => x.Login == dto.Login).FirstOrDefault().ID;
                    Assert.IsTrue(response.IsSuccessStatusCode);
                    Assert.IsTrue(feldmitarbeiterDTOList.Count != 0);

                    //Registrierung Waldeigentümer
                    request = JsonConvert.SerializeObject(waldeigentuemerDTO);
                    response = await HttpClient.PostAsync($"{BaseAdress.AbsoluteUri}Waldeigentuemer/",
                            new StringContent(request, Encoding.UTF8, "application/json"));
                    json = await response.Content.ReadAsStringAsync();

                    List<WaldeigentuemerDTO> waldeiegentuemerDTOList = JsonConvert.DeserializeObject<List<WaldeigentuemerDTO>>(json);
                    baum.Waldeigentuemer.ID = waldeiegentuemerDTOList.Where(x => x.Email == waldeigentuemerDTO.Email).FirstOrDefault().ID;
                    waldeigentuemerDTO.ID = baum.Waldeigentuemer.ID;
                    Assert.IsTrue(response.IsSuccessStatusCode);
                    Assert.IsTrue(waldeiegentuemerDTOList.Count != 0);

                    request = JsonConvert.SerializeObject(baum);
                    response = await HttpClient.PostAsync($"{BaseAdress.AbsoluteUri}Baum/",
                            new StringContent(request, Encoding.UTF8, "application/json"));
                    json = await response.Content.ReadAsStringAsync();
                    baumid = int.Parse(await response.Content.ReadAsStringAsync());

                }
            }
            finally
            {

                var isDeletedResponse = await HttpClient.DeleteAsync(BaseAdress.AbsoluteUri + "Baum" + "?Id=" + baumid);
                Assert.IsTrue(isDeletedResponse.IsSuccessStatusCode);

                isDeletedResponse = await HttpClient.DeleteAsync(BaseAdress.AbsoluteUri + "Feldmitarbeiter" + "?login=" + dto.Login);
                Assert.IsTrue(isDeletedResponse.IsSuccessStatusCode);

                isDeletedResponse = await HttpClient.DeleteAsync(BaseAdress.AbsoluteUri + "Waldeigentuemer" + "?Id=" + waldeigentuemerDTO.ID);
                Assert.IsTrue(isDeletedResponse.IsSuccessStatusCode);

                isDeletedResponse = await HttpClient.DeleteAsync("https://localhost:7001/api/Auth?login=" + User.Login);
                Assert.IsTrue(isDeletedResponse.IsSuccessStatusCode);
            }
        }
    }
}
